package org.nasdanika.drawio;

import java.util.List;
import java.util.Map;

/**
 * Represents mxGraphModel element
 * @author Pavel
 *
 */
public interface Model extends Element<Model> {
	
	/**
	 * @return Diagram root which contains layers.
	 */
	Root getRoot();
	
	/**
	 * Containing page
	 * @return
	 */
	Page getPage();
	
	@Override
	List<Root> getChildren();
	
	/**
	 * @return Unmodifiable map or null if there is no image
	 */
	Map<String,Object> getBackgroundImage();
	
	Model setBackgroundImage(Map<String,Object> image);		
	
	boolean isGrid();
	
	Model setGrid(boolean grid);
	
	int getGridSize();
	
	Model setGridSize(int gridSize);
	
	String getBackgrounColor();
	
	Model setBackgroundColor(String color);
	
	boolean isShadow();
	
	Model setShadow(boolean shadow);
	
	boolean isPageView();
	
	Model setPageView(boolean pageView);
	
	// TODO - dx,dy
	// TODO - page scale
	// TODO - page width/height
	// TODO - math - what is it?
		
}

